                              <h3><br />اللغة العربية هى لغة القران</h3>
                              <p class=""fst-italic"">
                                  لذلك حرصا منا على نشر تعليم اللغة العربية نحاول جاهدا");
                WriteLiteral(@"ً على توفير الوسائل المتاحة لكى نقدر على تعليم الاطفال والكبار هذه اللغة  وكما نعلم ان الاطفال الذين نشئو فى هذه البيئات لا يتحدثون اللغة العربية وقد يجد صعوبة فى تعلمها لذلك وفرنا نحن شركة ستارت أيات اكاديمى طرق سهلة لتعليم هذه اللغة لذلك وفرنا
